import React, {Component} from 'react';
import './App.css';
import SearchBar from './components/SearchBar';
import Ingredient from './components/Ingredient';

class App extends Component {
  state = {
    ingredientList: [
      {
        id: 1,
        title: "Brioche"
      },
      {
        id: 2,
        title: "Custard"
      },
      {
        id: 3,
        title: "Strawberry"
      }
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>App</h1>
        <SearchBar/>
        <Ingredient/>
      </div>
    );
  }
}

export default App;
